  false,\n\t\"url\": null,\n\t\"notes\": \"On or before September thirtieth, two thousand
  and three, and on or before the last day of every quarter thereafter, the mayor
  or his or her designee shall submit to the council and the comptroller a report
  detailing each small purchase award made pursuant to this section during the quarter
  that ended three months before such report is due and for which information is required
  to be contained in the computerized data base maintained pursuant to subdivision
  a of section 6-116.2 of the administrative code.\",\n\t\"license_title\": \"License
